import Banner from "../components/Banner";
import BoxArticle from "../components/BoxArticle";
import DashboardFooter from "../components/DashboardFooter";
import React, { useState } from "react";
import apiClient from "../helper/http-common";
import "./Home.css";
import AxiosHelper from "../helper/helper.ts";
import ListData from "../components/ListData";

const Products = (props) => {
  console.log(props.catId);
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState([]);
  let [pageNO, setPage] = useState(1);

  const fetchData = () => {
    console.log(pageNO);
    setLoading("Loading..");
    setData([]);
    const pageSize = 3;
    let server = new AxiosHelper(
      `/api/FoodDetail/GetAllByCategoryId?foodCategoryId=${1}&pageNo=${pageNO}&pageSize=${pageSize}`
    );

    server
      .get()
      .then((res) => {
        const obj = {
          pageType: "product",
          data: res.result.data,
        };
        console.log("Results: " + obj);
        setData(obj);
        setLoading("");
      })
      .catch((error) => {
        console.log(error);
      });
  };

  const nextClickHandler = () => {
    const val = pageNO + 1;
    setPage(val);
    //fetchData();
  };
  return (
    <div>
      <div className="container-fluid">
        <button className="buttonHome" onClick={fetchData}>
          Get Data
        </button>
        <ListData fData={data} />
        <p>{loading}</p>

        <button>Prev</button>
        <button onClick={nextClickHandler}>Next</button>
      </div>
    </div>
  );
};

export default Products;
